SELECT COUNT(`Number of Australians involved`) AS Total_Australians, AVG(`Number of Australians involved`) AS Average_Australians, MAX(`Number of Australians involved`) AS Maximum_Australians, MIN(`Number of Australians involved`) AS Minimum_Australians, SUM(`Number of Australians involved`) AS Total_Australians_Sum
FROM `table_1_10121127_1`
WHERE `Dates of Australian involvement`!= 'None';
